        export const faviconUrls = {"x.com/karpathy/status/1886192184808149383":"data:image/x-icon;base64,","docs.uniswap.org/contracts/universal-router/overview":"data:image/png;base64,","twitter.com/onplug_io":"data:image/x-icon;base64,","www.onplug.io/":"data:image/vnd.microsoft.icon;base64,","twitter.com/nftchance":"data:image/x-icon;base64,","twitter.com/drakedanner":"data:image/x-icon;base64,","www.onplug.io":"data:image/vnd.microsoft.icon;base64,","morpho.org/":"data:image/x-icon;base64,","greenfield.xyz/":"data:image/png;base64,","www.gelato.network/":"data:image/vnd.microsoft.icon;base64,","www.cursor.com/":"data:image/png;base64,","onplug.io":"data:image/vnd.microsoft.icon;base64,","chance.utc24.io/paper/glass-box/":"data:image/x-icon;base64,"} as const;

        export const posts: Posts = {abstractionfixesfragmentation:{filename:"abstraction-fixes-fragmentation",slug:"abstraction-fixes-fragmentation",title:"Abstraction Fixes Fragmentation.",description:"Over the past 4 years, the Ethereum community has been on a journey that began with an attempt to scale Ethereum and has ended in a fragmented mess....",image:"/cdn/papers/abstraction-fixes-fragmentation.png",content:"\n\n### TLDR:\nThe Ethereum community sentiment is pretty bad right now after watching Solana eat its lunch despite having a massive cultural headstart. I attribute this to cultural fragmentation caused by L2 scaling attempts that tried to build miniature versions of Ethereum with miniature cultural moats. Teams are working on solving this through chain abstraction. I suggest that consumer application accessibility can go beyond chain abstraction by abstracting away protocol interfaces. \n\n## The EVM in 2025\n\nOver the past 4 years, the Ethereum community has been on a journey that began with an attempt to scale Ethereum and has ended in a fragmented mess made worse by infighting between cohabitating ecosystems. When layer 1 fees became too expensive for day-to-day transactions, we were met with the promise of layer 2s. This scaling ideal has resulted in a proliferation of rollups and EVM compatible alt layer 1s. We have more blockspace than ever before and we've paid for it dearly through diminished user experience. Without ongoing efforts to abstract the chain away from users, the idea that we may onboard new users to Ethereum presents as laughable.\n\n\nAs of March 2025, DefiLlama lists nearly 250 EVM chains.\n\nFragmented users and fragmented liquidity lead to fragmented experiences. While early Defi saw flows into major protocols, the eventual rise of transaction costs led protocols to incentivize liquidity on newer, cheaper chains. The only issue? Once these incentives dry up, mercenary yield seekers simply jump to the next incentivized chain.\n\nOver and over again we've seen chains launch to fanfare and then fade into the distance as hotter, younger chains began their own protocol incentive pump cycles. As a user, the EVM has become a shell of the promise that it offered as the world computer. How can we support global financial rails and a single settlement layer when engaging with the system requires moving assets across chains, switching chains in your wallet, and reconsolidating assets into the chain that you prefer.\n\n## Culture to User Ratio Mismatch\n\nFor a long time, I viewed Ethereum's moat against Solana and other chains as cultural. Ethereum's community of Defi builders, long lasting NFT artifacts, and DAO proliferation were admirable. In fact, I'd argue that this mix of organizations and use cases was so valuable that the L2s sought to recreate them. Every EVM chain wanted to go viral with an NFT drop, Defi TVL metrics, or onchain based organizations.\n\nAll of a sudden, instead of a single strong culture, the EVM was supporting many cultures. On the surface, this appears to be a good thing! A playbook has been discovered to build a culture on a chain, whether or not that culture is a moat, however, is vastly different. Many users that I've talked to over the past few years working in crypto product development have been upfront with me that 1) they have a favorite ecosystem 2) they will try out new ecosystems 3) they try new ecosystems for speculative purposes 4) any gains made in the new ecosystem are swiftly returned to their preferred ecosystem. These users are self-admitted mercenaries who have already chosen their onchain home and leave only to bring back the riches they plunder from elsewhere. Unfortunately, we do not have enough users to support this many cultures.\n\n## User Experience Decline\n\nThe explosion of new chains and reality of mercenary users initially presents as downside for chains and upside for users. Chains have to deal with the ebbs and flows of user preferences impacting their primary KPIs (token price, TVL, users, tx volume, etc) and users have the opportunity to explore new spaces and access additional yield or airdrop potential. Most users, however, aren't hunting these airdrops or exploring these spaces. Individuals running large bot networks are often the first-in and first-out of these nascent ecosystems while everyday users might show up to fight for crumbs and then end up leaving dust.\n\nAs new apps and protocols choose Ethereum scaling solutions to call home, users are forced to add these chains to the stack of ecosystems they interact with. User assets are spread out all over the place resulting in bridging requirements whenever it comes time to make a large transaction or claim an airdrop.\n\n## Failed Differentiation\n\nAs a user, I've personally become extremely fatigued by ongoing launches of new ecosystems and shallow attempts to cultivate cultural moats. I miss the old Ethereum -- an expansive world of sophisticated financial transactions, artistic artifacts, and decentralized autonomous organizations. While holes could be poked in all of these, there was an understanding of a shared virtual machine with a single settlement layer before Ethereum fragmented. None of these new Ethereum scaling solutions have brought anything unique to the table that differentiates them greatly to me -- their largest value proposition is cheaper transactions.\n\n## Chain Abstracted Applications\n\nDue to the immutable nature of these blockchains, we must accept the fragmentation that has occurred. We will never coalesce all assets back to the layer 1 and users will continue to maintain asset balances across these chains. After spending the past 4 years building infrastructure, the time of the application has arrived. The opportunity to bring these experiences and assets together exists at the application layer, where the user interacts with these ecosystems.\n\nMany teams believe that abstracting away chain complexity without sacrificing capabilities represent the next evolution of the EVM ecosystem. When interfaces can seamlessly bridge the gaps between chains, users can focus on strategy rather than logistics. When protocols can be composed across chains through a unified interface, we may recover much of what made early Ethereum magical.\n\n## Protocol Abstracted Interfaces\n\nWhile chain abstraction makes consumer applications more accessible, it is only a step towards a more user friendly onchain experience rather than the destination. Alternative attempts include interfaces that allow access to and composition of many underlying protocols. Thanks to public smart contracts, development teams are free to create new experiences at the application layer without needing to reinvent or even implement anything at the protocol layer. \n\nI may even go as far as saying that there is no need for further smart contract development – there are no new primitives to be deployed.\n\n## EVM Ecosystem Unification\n\nThe EVM remains the greatest technology-based human coordination system the world has ever seen. Let's not diminish its power by forcing users to navigate its fragmented landscape manually. Instead, let's abstract that complexity and put the full potential of the entire EVM ecosystem at their fingertips.",attributes:{created:"2025-03-17T05:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},oneapp:{filename:"one-interface",slug:"one-app",title:"One App to Rule Them All.",description:"Every significant advancement in technology has been marked by the emergence of sophisticated tools that serve its most dedicated users. Traditional finance has its Bloomberg Termi...",image:"/cdn/papers/hello-world.png",content:"\n\nEvery significant advancement in technology has been marked by the emergence of sophisticated tools that serve its most dedicated users. Traditional finance has its Bloomberg Terminal. Software developers have Visual Studio Code and its forks. These aren't just interfaces - they're command centers where information and control converge with precision. DeFi deserves the same level of sophistication and control. We're here to put a serious battle station in your hands.\n\n## The Current Reality\n\nIf you're reading this, your setup probably looks familiar: multiple monitors streaming real-time data, Telegram notifications cascading in the background, and browser tabs multiplying faster than your holdings. You've mastered the art of context-switching between protocols, manually orchestrating executions, and tracking positions across an increasingly fragmented landscape. This isn't sustainable. Not because we \"need to touch grass\" or because \"the brainrot goes too deep\" - but because we need better tools.\n\nThe data confirms what we already know from experience. Onchain research from [Greenfield Capital](https://greenfield.xyz/) shows that a critical 25% of sessions involve users executing 2-10 transactions in sequence. These multi-transaction sessions account for a staggering 45% of all onchain activity.\n\nThink about that. Almost half of all onchain transactions occur when users are executing multi-step workflows, jumping between different protocol interfaces, and manually orchestrating complex actions. That's not just inefficient—it's a massive opportunity cost for everyone except the MEV bots feasting on your predictable transaction patterns.\n\n## The Everything Aggregator\n\nWe built Plug to be the command center that DeFi has been missing. This isn't another aggregator - it's a professional-grade interface that brings true protocol composition and strategy execution to your fingertips.\n\nWith Plug, you gain:\n\n- Deep Protocol Integration: Combine the full capabilities of major protocols without compromise\n- Constraint-Driven Execution: Set precise conditions for your transactions to execute automatically\n- Custom Workspaces: Arrange critical information and controls exactly where you need them\n- Strategy Composition: Deploy complex multi-protocol strategies with professional-grade tools\n\nPlug offers a never before seen user experience for DeFi power users through its intent creation interface and generalized solver system. While some modern protocols such as [Morpho](https://morpho.org/) and Uniswap's [UniversalRouter](https://docs.uniswap.org/contracts/universal-router/overview) offer their own bundlers and routers, most protocols don't offer this capability at all. Beyond general bundle preparation, however, Plug is the first product to offer true cross-protocol constraint-driven onchain bundles.\n\nWith Plug, you can finally compose transactions across any integrated protocol, setting precise execution parameters that respect your strategy requirements. All without requiring you to babysit your position or execute each step manually. This isn't just convenience - it's the difference between capturing opportunities and missing them entirely.\n\n## Beyond Basic Aggregation\n\nWe're not here to simplify DeFi by reducing its capabilities. We're here to make its full power accessible through an interface worthy of how you operate.\n\nImagine:\n\n- Monitoring complex positions across protocols with institutional-grade precision\n- Deploying automated strategies that execute exactly as intended, even while you sleep\n- Creating custom views that adapt to different market conditions and strategies\n- Composing protocols in ways that unlock entirely new possibilities\n\nThe interface itself is designed for information density without overwhelming you. Key metrics are customizable and positioned exactly where you need them. Critical controls are always accessible. The days of searching through bookmarks for that one protocol interface you need are over - everything is integrated into a cohesive command center that lives right at your fingertips.\n\nGreenfield's research found that users cited two major barriers to adopting automation tools: trust and complexity. Plug addresses both head-on. You're not ceding control to a black box—you're defining precise constraints for execution within a what we like to call a [Glass Box](https://chance.utc24.io/paper/glass-box/). While the power under the hood is sophisticated, the interface is designed for DeFi practitioners who value clarity and control.\n\nThis makes sense when you consider that 84% of users surveyed don't use any automation tools today, despite spending significant time executing multi-step transactions. The market is primed for an interface that doesn't compromise on control while eliminating the inefficiencies of manual execution.\n\nGreenfield's data also shows that the most active 5% of users are executing bundles of more than 10 transactions in sequence, suggesting use of proprietary infrastructure. These power users have built their own solutions out of necessity and are getting outsized return from their custom tooling. Plug brings these capabilities to everyone who wants to operate at a high level without requiring maintaintaince custom code or infrastructure.\n\nThis is Plug - where professional capabilities meet relentless innovation.\n\n## The Future of DeFi\n\nWe build for the traders who track their positions in their sleep. For the yield farmers who optimize their strategies down to the gwei. For everyone who sees DeFi not just as a market, but as an arena where technical excellence meets strategic mastery. This isn't about making DeFi easier - it's about making it more powerful. About giving you the tools to execute your vision with the precision it deserves.\n\nWhat we're building goes beyond convenience. This is about setting a new standard for how we interact with DeFi. Where professional-grade capabilities aren't just accessible - they're expected. Where the interface itself becomes an advantage rather than an obstacle.\n\nReady to take control? Join the waitlist at [onplug.io](https://onplug.io).\n",attributes:{created:"2025-03-06T06:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},whywebuiltplug:{filename:"why-we-built-plug",slug:"why-we-built-plug",title:"Why We Built Plug.",description:"Crypto has the potential to change the way people use money for decades to come. It feels like a dream where you have real ownership of your money. Where you arent resorting to a...",image:"/cdn/papers/hello-world.png",content:"\n\nTLDR: Crypto as an industry holds tremendous potential to redefine how money is used globally, but the requirement of manual transactions in a fragmented ecosystem has resulted in growing inefficiencies with no effective solution today. The introduction of automated strategies accessible in a single click enables users to realize many of the initial dreams of crypto that countless were sold on.\n\nCrypto has the potential to change the way people use money forever.\n\nThe ideal world of crypto still feels like a dream. A world where you have real ownership of your money. Where you aren’t resorting to a bank with a 2/3 multi-sig between you, the bank, and government. Where you can spend your money how you please without concern of geographical restrictions or rules. Where you can escape local inflation and find safety in an asset that has more sound fiscal policy without a money printer that constantly dilutes your buying power.\n\nYou can boil everything down to: crypto is programmable money that lets people fully utilize their money however they prefer. It's control, freedom, transparency and verifiability all combined into a single financial offering. \n\nIn 2021 a shift began, though. \n\nTransaction costs of Ethereum mainnet transactions had become prohibitive. It was very expensive to do even the most basic transactions. Optimizing gas consumption for smart contracts was critical. Without efficient models in place, protocols became effectively unusable.\n\nAs Layer 2s (L2s), transactions that post transaction records back to Ethereum, began spinning up the existing users and ecosystem found itself in a place where monetary and operational security was abstracted into smaller selective pieces. But, users could finally transact for fractions of a cent without making compromises on the benefits they gained. \n\nWith the continued focus on driving user-facing costs lower the market eventually reached a point of hyper specialization where general L2s became app chains that aim to do one thing very well. Avoiding the value of network effects, protocols began optimizing for the lowest possible costs while introducing new central authority risks, walled gardens, and liquidity fragmentation that negatively impacted everyone and every protocol, including the app chain itself.\n\nAt the same time in another piece of the industry, we saw account abstraction take hold. Account abstraction in the form of EIP-4337 had two major goals:\n\n- Enable new signature schemes that weren't reliant on existing private key mechanisms.\n- Solve the cold-start problem that forced users to have money to pay for gas before running their first transaction.\n\nMany developers and VC firms believed that the biggest user hurdle was how messages are signed and that the need for gas was a significant limiter of adoption. At the same time, we saw millions of dollars pour into passkey solutions that do simplify the user experience by introducing authentication methods native to the device the user is on like FaceId.\n\nYet, even with the continued growth and adoption of account abstraction, the core user experience did not and will not nominally change outside of being able to log in with your Google account or Device Passkey.\n\n## Money as Cash\n\nStill, with all the effort, the user experience largely remained the same and even degraded in several places. You are still required to do everything manually. You still have to choose favorite protocols. You still can't achieve the basic practices of money management like a savings account that generates consistent yield without risk.\n\nIn all regards, every single user of crypto has been left to use their magic internet money like it is cash:\n\n- You must transact in person by clicking buttons one by one.\n- You must pay current market rates instead of being able to unlock the capital efficiency of futures.\n- You must constantly be aware and knowledgeable enough to manage your own finances because financial advisors don’t really exist for this sector.\n\nThe most simple things that we have become used to like rent auto pay, automatic credit card payments to cover debts, mortgages that draw from our savings fund on a set basis are not options today. Nothing of this sort exists for crypto at scale and it can’t in the current model due the explicit need for transactions that are signed by private keys or the use of protocols designed for explicit legacy transactions.\n\nEven more drastically, you do not even have the capacity to operate in a market that never closes. Even if you work in crypto there is a zero percent chance that you spend multiple hours a day onchain or even inside the applications of crypto protocols.\n\n![You are offline a majority of the day](https://cdn.onplug.io/posts/why-we-built-plug/never-online.png)\n\nYou are at an inherent disadvantage. Everyone is. The broader ecosystem is being held back at the most fundamental layer by being forced to operate as if our crypto is cash rather than magic internet money as we know it to be.\n\nIn the end, so many non-crypto individuals liken the market to a degenerate equities market because in practice, it really is little more than that for most. The foundation for normal users to utilize their internet money like it’s actually digital doesn’t really exist.\n\n## The “There’s Nothing to Do” Paradox\n\nThis issue is rooted deeper than priorities or user interest though. It’s not uncommon to hear participants of the current market remark that people do not care about decentralization; that all people want to do is gamble. For some, they aren’t far from the truth.\n\nIn reality, gambling is the product for *many*. But, what many often fail to realize is that carrying that belief is a statement of defeat. A perspective only formed through disgust and biased perspective without consideration of what the alternative truly looks like.\n\nThose holding this perspective aren’t wrong, because well, there’s not much a normal user can do to get exposure to the benefits of crypto today. Unless you’re willing to become a psuedo-economist, the learning curve of how to use your money is much steeper than the difficulty ramp of buying crypto and holding it in spot. This is why only 1% of all crypto users use any semblance of DeFi. It’s unapproachable, confusing, and in general much riskier than other alternatives. Especially to people who are not willing to live and breathe the contents of the industry.\n\nYou have people trying, the basis is improving, but the experience pattern is still exceptionally subpar. So, the general user strapped with typical equity-market knowledge buys a few tokens, a few memecoins and forgets about it as they sit on their spot position while being completely blind to the real value the industry has to offer them; not really to their own fault.\n\nEven for those that do know, the case is still much the same. When you summarize the general DeFi ecosystem you quickly realize that the majority of primitives today are focused on two things:\n\n1. Asset acquisition.\n2. Asset utilization.\n\nWith so little diversification your options for capital management are extremely limited. \n\nIn most situations, users are really just choosing between a brand and the attached incentives that exist outside the base protocol. If the limitation stopped there it could be easily addressed, though. \n\nThe deeper reality is that there simply isn’t much to do when everything requires you perform every action manually. Users can't really be glued to their devices at all time. Even if they choose to be, there isn't enough in crypto that provides entertainment to be online 24/7.\n\nFor many, there exists no interest in doing research about all the options before deciding where they should use their capital. Even when users finally understand a protocol they have no way of comparing it to the best rates or determine what gives them the best outcomes without having vetted every option available.\n\nAs a new market entrant your pool of options is small. Knowledge isn’t implicit, but ignorance is. It takes years to understand the new models in place. Without a close network of people that are deeply integrated it can be weeks until you even discover a protocol that gives you the functionality you are looking for.\n\nSome chalk this up to discovery quality being poor, but really it’s that delivery is poor. Even with a vastly improved discovery process users will not have a vastly improved experience. \n\nA user should not need to know these things or do this work to get the benefit of crypto. Until they can get the benefits without such an extreme level of required knowledge, the market will feel empty and the general consumer of the world will stay far away. Until it as simple as depositing into a bank account and immediately earning yield, there is no hope for real mass adoption.\n\n## Billions in Inefficiencies \n\nWithout people transacting though, there is a constant lack of liquidity. Coordination of people is difficult. Coordination of liquidity is abysmal. There’s forever several yield protocols offering exceptionally high yield rates as they vie to become a king of the market. Forced to overpay, incentives flow in a way that results in limited growth and parasitic tendencies simply because a certain mechanism has not been capable of securing enough liquidity to function.\n\nPerpetually compared to traditional rates of a bank account, users must make the constant decision if the newly introduced risk by crypto is worth the additional yield.\n\nToday, fragmentation of chains has exacerbated this risk and knowlege issue. Users have more money onchain but that money is less concentrated than ever before. It’s distracted in all the worst ways:\n\n- It’s spread across several different chains, many of them being fundamentally incompatible with one another.\n- It’s siloed into countless wallets and continues to grow in disparity as embedded wallets continue to be pitched as a major value prop. because now users can sign up with their email.\n- It’s delivered through wallet apps that show a single token across different chains as unique assets because the team can’t figure out how to unify the canonical reference with the social ones.\n\nIn every way, using your money onchain today is significantly worse than it was years ago. As an industry a lot of money and labor has been spent, but what benefit did it actually give users that are here today? Effectively nothing.\n\nBecause of this, protocols for the most part, operate in a worse ecosystem than ever before. The patterns needed to enable effective operation have disappeared. It is not that the market became competitive. It is not that the protocol isn’t appealing. The fundamental thesis and promise of blockchains and the value of network effects, simply put, was broken. Users aren’t the only ones that suffer, protocols feels that effect even more and this flywheel is accelerated by every investment into a hot new L2 that’s chasing the opportunity to allocate 40% of its token to investors.\n\nIt is the money ouroboros of the industry. So, while it feels bad today, it is only going to get much worse if a solution does not become available very soon.\n\n## Chain Abstraction\n\nFinally though, there’s at least real conversation about this problem. Primarily in the form of *chain abstraction* which is a commonly held belief that the path to correction here is one led by the idea that balances across all chains should be utilized as one. For a simple example here:\n\n![Chain abstraction money flow](https://cdn.onplug.io/posts/why-we-built-plug/chain-abstractions.png)\n\n- If you have USDC on Base, but want it on Arbitrum, you should be able to use that money with ease.\n\nUnfortunately though, this belief is good in nature but exceptionally weak in reasoning tolerance while being exceptionally idealistic. Rather than fixing the fundamental problem, chain abstractions is permission granting to exacerbate the problem and leans into the hideous nature of a system where fragmentation is a systemic issue that’s never properly addressed.\n\nWhile it seems to track logically, the idea quickly falls apart as you begin to dig into what this direction really means and what it enables. We’ve covered a basic example of the hopeful outputs, but we must consider what benefit, we, the users of the industry, get out of it. In the simplest answer, you get little tangible benefit:\n\n- Your experience is still worse than it was years ago.\n- Your settlement and transaction times are longer and more error-prone.\n- Your cost of interactions grows significantly now that complexity of even the most simple transactions has been multiplied by many factors.\n- The risk profile grows substantially as you introduce more middle men and non-atomic settlement into the standard execution path.\n- Your ability to utilize the efforts of the last years effectively vanishes as things are siloed into their own ecosystem.\n\nIn nearly every single situation, a philosophy of *one balance* is delivering users a trash experience that has been disguised as a cherry pie with a dollop of whipped cream on top. It is a step backwards covered in a mirage of technical jargon and improvement. It's an idea simple to sell to the non-technical. But, it is exceptionally hard to build around, insanely detached from real-world benefit, and is stuck at square one where you can count those making real progress and improvements on one hand.\n\nThe idea that chain abstraction is a solution is especially confusing when acknowledging that leading wallet applications have been stagnant for years after having done little more than copy-pasting the designs of one another with little change or evolution... And users don't easily change the wallet they daily-drive.\n\nYet, it is a righteous desire. I don't discount them or blame them for trying. There's a group of people working to improve the space with a temporary solution while the long-term one is established. Chain abstraction simply isn't the most direct or realistic path to an improved ecosystem or user experience.\n\n## Directionally Correct\n\nSo, if we understand the problem to result in a bad user experience and ineffective liquidity management what can we do to improve that? Really, it's simple. It's just highly under-funded and under-developed.\n\nThe obvious answer here is enable *atomic transaction automation*.\n\nIn the last few years there have been several attempts to do this. You do have platforms like [Gelato](https://www.gelato.network/), but it was made for the highly technical and failed to enable the general end-user. You still have to write code to get any level of functionality while dealing with a much worse user experience. Even more recently they have pivoted and directed their focus away from improving this product. Antithetically too, you are trusting Gelato with the outputs of automation and thus inputs of transactions. \n\nSo, not only have users not been empowered with the functionality that brings real improvement to the industry, the only real option also comes with a big set of drawbacks that have made the rate of adoption extremely low. More importantly, the general consumer and blockchain user still effectively has no option to choose from.\n\n## Automation Is Not Solved\n\nIn the meantime though, a few protocols have risen that claim to empower users with the capabilities of automation. Generally, they are using the word incorrectly and are making a claim that is fundamentally false. Instead, these protocols are really offering increased yield through managed vaults that have a single vault like:\n\n1. Users deposit into a vault.\n2. The operator of the vault rebalances the position.\n3. Yield is increased due to centralized management.\n\nThe user has not been empowered to automate anything. The user deposits into a vault that they have no real control or influence over. Users of yielding-vaults have been empowered with an increase in yield, not automation.\n\nStill today users are left without any real option to create strategies or even to adopt strategies that already exist. Even the most technical developers such as Foundry framework developers struggle to provide this functionality to themselves after having invested hundreds of hours into building a system of their own. Of course, there are MEV bot frameworks that you can adopt, but you are left to do everything yourself. \n\nThere is not a single market-accessible automation solution that supports general execution and highly customized strategies without requiring the user to be exceptionally sophisticated.\n\n## Our Future\n\nWe are here to solve this with Plug. \n\nPlug is the single destination for all your crypto activities in one place. We're not just another wallet or interface - we're building a comprehensive platform that fundamentally changes how you interact with blockchain:\n\n- **Multi-account portfolio management**: Unified view and control of all your assets across different wallets and chains.\n\n- **Complete ecosystem composability**: Interact with any protocol through a single, intuitive interface.\n\n- **Automated strategies with granular control**: Create, customize, and deploy sophisticated transaction strategies without writing code.\n\n- **Reactive runtime transactions with coils**: Dynamic data-driven transactions that adapt to market conditions in real-time.\n\n- **Set-and-forget automation**: Systems that optimize your positions 24/7 without requiring constant monitoring.\n\nWhat all of this enables is a set of experiences and features that cannot be found anywhere else in the crypto ecosystem. As we get closer to our public launch, we'll share more details on each of these capabilities and how they work together to create a seamless experience.\n\nIt should be clear that we are here to redefine what the typical user experience looks like and deliver automated-enabled features that help you outperform. It's not another piece of infrastructure designed to only be used by 20 companies. \n\nPlug has been a venture of passion built by rethinking every small detail of how you interact with blockchains today. It's been crafted with the hindsight of past mistakes and the foresight of a clear future where humans no longer need to manually execute every blockchain transaction. We've prioritized a user-first mindset rather than a tech-first approach, always keeping your needs and experience at the center of our design philosophy.\n\nThe journey to redefining crypto interactions starts here. Make sure to [follow along on Twitter](https://twitter.com/onplug_io) so that you are the first to know as we reach the next steps.\n",attributes:{created:"2025-03-06T06:00:00.000Z",className:"",tags:["perspective"],author:"nftchance"}},infrarace:{filename:"infra-race",slug:"infra-race",title:"The Infrastructure Race.",description:"Theres a scene in the Big Short where Brownfield Fund visits JPMorgan with the goal of getting an International Swaps and Derivatives Association ISDA agreement to be able to tr...",image:"/cdn/papers/infra-race.png",content:"\n\nThere's a scene in the Big Short where Brownfield Fund visits JPMorgan with the goal of getting an International Swaps and Derivatives Association (ISDA) agreement to be able to transact in long term derivatives. The owners of Brownfield saw an opportunity, but they needed an ISDA to be execute the trade. The only problem? Their AUM of $30m was \"about 1 billion 470 million short\" of the capital requirement needed to qualify for an ISDA. No ISDA, no trade.\n\n![Image from the Big Short discussing the value of the ISDA](https://cdn.onplug.io/posts/infra-race/isda-2.png)\n\nSuccess in markets is often viewed through the lens of information and execution speed but the example from The Big Short highlights an oft-overlooked third component: Transaction Infrastructure. Even if you have the best information in the world, you may not be able to execute the trade without the right infrastructure.\n\nWhile information flows and execution speed are important in crypto, this third component is exacerbated in a way that differs from historical understandings. Sure, we can talk about how to know which tokens to buy or which airdrops to hunt, we generally understand that there are MEV bots that trade faster than we can, but we rarely talk about the infrastructure that allows us to transact in the first place.\n\nI've identified 6 tiers of transaction sophistication within DeFi. Let's dig in.\n\n## Levels of Transacting\n\nWhen we transact onchain, we're competing with other users for block space. Our ability to capture alpha is limited by our transaction capabilities. Are you able to prepare the transaction required and get it into an optimal block?\n\nBut before we get onchain, let's start with the basics.\n\n### Tier 1: Centralized Exchange Users\n\nThese users are most likely spot traders or long term holders. They may utilize some of the Earn products that lend or stake their underlying tokens. They may pay a monthly fee for fee-less trading with something like Coinbase.\n\nThe vast majority of crypto participants never leave this tier. They're comfortable with familiar interfaces that mirror traditional finance platforms, and they accept the trade-offs: higher fees, centralization risk, and limited access to DeFi's innovation. For many, this is a reasonable choice—they prioritize convenience over sovereignty and potential yield.\n\n### Tier 2: Self-Custody Beginners\n\nThe leap from Tier 1 to Tier 2 represents one of the most significant psychological barriers in crypto adoption. Self-custody means taking responsibility for your assets. These users have taken their first steps into true crypto ownership, but they're still paying a premium for simplified interfaces that abstract away the complexity of the underlying protocols or failing to identify the highest upside opportunities.\n\nThey might swap or stake inside of the Ledger app or the Metamask extension but they aren't seeking out the best rates across the ecosystem.\n\n### Tier 3: Simple Protocol Users\n\nAt this tier, users begin to directly interface with the protocols that power DeFi; they're using Uniswap to swap and Blur to find NFTs. They've learned to connect their wallets to dApps and execute basic transactions. They typically interact with one protocol at a time, however, missing opportunities for composability—one of DeFi's most powerful features. Their transactions are often suboptimal, paying higher fees than necessary and frequently falling victim to MEV extraction.\n\n### Tier 4: Advanced Protocol Users\n\nTier 4 users have developed a working mental model of DeFi's ecosystem. They understand that liquidity is fragmented across protocols and use aggregators to optimize their trades. They've learned to adjust gas settings and may time their transactions to avoid network congestion. These users capture more value than those in lower tiers, but they're still executing transactions manually and reactively rather than programmatically and proactively.\n\n### Tier 5: Weapons-Grade Protocol Users\n\nThis is where the playing field begins to tilt dramatically. Tier 5 users have crossed into professional territory, viewing each transaction as a competitive event. They understand that the mempool is a battlefield where transactions compete for inclusion, and they've equipped themselves with specialized tools to gain an edge such as Flashbots MEV Protect. These users have invested significant time in understanding blockchain mechanics beyond the application layer, allowing them to execute strategies that would be impossible for users in lower tiers.\n\n### Tier 6: Custom Infrastructure Developers\n\nAt the apex of transaction sophistication are those who have built custom infrastructure tailored to their specific strategies. These are typically institutions, protocols with dedicated development teams, or sophisticated individual traders with programming backgrounds. Their systems monitor onchain and off-chain data continuously, identifying opportunities and executing complex transaction sequences without human intervention. These actors deploy capital programmatically and the alpha they capture is often invisible to lower tiers until well after the opportunity has passed.\n\n## The Infrastructure Gap\n\nThis infrastructure gap represents one of DeFi's most significant barriers to true democratization. While we celebrate the removal of traditional gatekeepers, we've created new ones based on technical capability rather than capital or credentials. The resources required to build and maintain Tier 6 infrastructure are beyond the reach of most individuals and smaller organizations, creating a new form of financial exclusion masked as meritocracy.\n\nThe gap is widening, not narrowing. As protocols become more complex and interconnected, the knowledge and infrastructure required to interact with them optimally increases exponentially. Each new innovation—from new L2s to cross-chain bridges to novel financial primitives—adds another layer of complexity that must be integrated into existing systems.\n\n## Democratizing Transaction Sophistication\n\nThis is where Plug enters the picture. We've built the infrastructure so you don't have to. Our platform provides the sophisticated transaction capabilities of Tier 6 with the accessibility of Tier 3 or 4. We believe that transaction infrastructure should be a utility, not a competitive advantage available only to the technically elite.\n\nBy abstracting away the complexity while maintaining transparency and control, we're enabling users to focus on strategy rather than execution mechanics. Whether you're looking to optimize a simple swap or orchestrate a complex cross-protocol strategy, Plug provides the infrastructure to execute it effectively.\n\n## The Future Belongs to the Infrastructure-Enabled\n\nAs DeFi continues to evolve, the advantage will increasingly shift toward those who can execute transactions most effectively. Information asymmetry is rapidly diminishing as news spreads instantly on Twitter, Discord, and Telegram. Speed advantages are being commoditized through better block builders and MEV-Share. The edge that remains is the ability to compose complex transactions that capture value across the fragmented DeFi landscape.\n\nThe future of DeFi belongs to those who can harness the full power of its composability. Not just understanding it conceptually, but having the infrastructure to execute on that understanding programmatically and reliably. This is the new frontier of financial advantage—not what you know, but how effectively you can act on what you know.\n\nDon't get left behind in the infrastructure race. Join [Plug](https://www.onplug.io/) today and take your first step toward adopting transaction infrastructure built for you.\n",attributes:{created:"2025-03-03T06:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},chatinterfaces:{filename:"chat-interfaces",slug:"chat-interfaces",title:"Chat Interfaces and Crypto Agents.",description:"Every morning, I wake up and start working with a symphony of AI assistants. Claude helps architect our systems, Cursor generates our code, ChatGPT brainstorms solutions, Perplexit...",image:"/cdn/papers/hello-world.png",content:"\n\nEvery morning, I wake up and start working with a symphony of AI assistants. Claude helps architect our systems, Cursor generates our code, ChatGPT brainstorms solutions, Perplexity researches edge cases, the list goes on. My reality is highly AI-augmented.\n\nSo when someone sends me yet another crypto agent chat interface, I get why they're excited. The promise is intoxicating...\n\n\"What if you could just tell an AI to make you money?\"\n\nJust tell an AI what you want, and it handles all the complexity of crypto for you. No more juggling DEX interfaces, tracking yield farms, or monitoring positions across chains. Just vibes and gains.\n\nBut I'm frustrated because no one has shown me an agent that can do something other than swap or bridge. No one has shown me a chat interface for transaction definition that actually works. Right now, we're swimming in demos and pitch decks while hard problems remain unsolved.\n\nAlthough it's early, there's an exciting future for these proof of concept ideas. Many societal markers point towards a future with systems that transact on behalf of humans using crypto: users believe in this future, investors believe in this future enough to fund it, builders are attempting to create this future, etc.\n\nLast week we budgeted a few hours to explore what a chat interface for Plug might look like. It is scrappy, but it's better than every single market-available \"agent\" that exists today.\n\nMorgan can read your wallet contents, build and discover Plugs to use, suggest actions based on your goals, run and schedule your Plugs, re-organize the app with a live context-based layout, etc. It only took a ~300 lines of code to significantly improve upon the experience that is readily available today.\n\n![An example of Plug's chat interface in action](https://cdn.onplug.io/posts/chat-interfaces/1-morgan.png)\n\nIf you want to try Morgan out someday, sign up for the [Plug waitlist](https://onplug.io).\n\nAfter testing other crypto AI agents and exploring the chat interface in our product, I've come to a realization: we're asking the wrong questions about what AI should do in crypto.\n\n## Current State of Crypto AI Agents\n\nThe gap between promise and reality becomes clear when we examine actual implementations. Let's look at some leading attempts at crypto AI agents to understand what their successes and limitations reveal about our current approach to AI in crypto.\n\n### Nani.ooo\n\nNani was one of the first intent agents that I came across midway through 2024 and became the first “agent” project I tried out. When I first tried nani.ooo, it was a Windows Desktop-esque experience with different apps I could click into, one of which was the chat interface. After depositing ETH, I was able to use the chat interface to swap to NEETH (their own token).\n\nWhen I try to use the interface today, the experience is more similar to ChatGPT and it does seem to try to write an intent and post it to the Nani Deployer contract.\n\n![Nani.ooo interface writing an intent using an LLM chat interface](https://cdn.onplug.io/posts/chat-interfaces/2-nani.png)\n\nWhen I click EXECUTE ON SMART WALLET, I get error messages that don’t allow me to move forward. I see that there are some other commands written to the contract on Basescan.\n\n![Basescan interface showing transactions to the Nani Deployer contract](https://cdn.onplug.io/posts/chat-interfaces/3-basescan.png)\n\nMy experience ended here. My understanding is that in it's current state, Nani is more of a set of developer tools than a consumer product.\n\n### Griffain\n\nAfter trading the $GRIFFAIN AI memecoin, I finally was able to try out the platform. I had to spend 2 SOL to get access and then ended up in an interface with a bunch of different “agents” available to me.\n\n![Griffain agent marketplace](https://cdn.onplug.io/posts/chat-interfaces/4-griffain.png)\n\nI chose to interact with the Sniper Bot and did not have the best experience. I was expecting to have a back and forth with the agent about what we’d be doing together but instead it felt like I kicked off an open script to buy memecoins based on parameters loosely defined in my sentence: Only snipe if the description mentions AI.\n\n![Griffain sniper bot](https://cdn.onplug.io/posts/chat-interfaces/5-griffain.png)\n\nWhen we think about generalized intents, should the AI help you devise the intent or should the AI write the intent for you? At which point do you give over the wheel and say send it?\n\n## The Chat Interface Oversimplification\n\nUsing a chat interface to write financial transaction instructions isn't just inefficient - it's technological regression. We've moved from command line interfaces to graphical UIs because they're more efficient, only to circle back to essentially typing commands in natural language? It's like replacing your banking app with a local bank branch.\n\nThe promise of AI isn't in making simple tasks more complicated - it's in making complex tasks more approachable. Yet current crypto chat interfaces often add unnecessary steps to straightforward operations while failing to meaningfully handle complex ones.\n\n## The Intent Behind AI Agent Usage\n\nMy user experience with these products has led me to wonder what users truly want out of chat interfaces and AI agent interactions?\nUsing LLMs in our worfklows adds value because we can…\n\n- Offload decision making and responsibility\n- Abstract complexity\n- Be met where we are informationally\n- Interact with a personality that guides and entertains us\n  Interacting with software through an anthropomorphized chat interface isn’t a wholly new concept but it’s one that has been highly re-popularized since the release of ChatGPT in late 2022.\n\n  Early story based video games could be interacted with through a chat interface that allowed players to type commands to move through the story.\n\n  While software products with buttons communicate where the boundaries are, chat interfaces allow you to think anything is possible… even if it isn’t. The blackbox aspects of LLM chatbots lead to a sense of wonder – one of the few pieces of consumer technology that still feels magical to us today.\n  But as Chance mentions in [The Glass Box](https://chance.utc24.io/paper/glass-box/):\n\n> _These models optimize for scale, minimizing the cognitive load on users. The complexity is hidden to provide an interface that \"just works.\" But here lies the flaw: the more hidden the system, the more prone it becomes to misuse, misunderstanding, and distrust. It introduces fragility where transparency could build resilience._\n\nBy trading an aspect of our autonomy for convenience and wonder when offloading decision making to opaque LLMs, we introduce room for influence and error.\n\n## Real Utility in AI Crypto Agents\n\nIn many cases, trading off nuance control to an LLM for speed in output is net positive. Earlier this month, [Andrej Karpathy](https://x.com/karpathy/status/1886192184808149383) beautifully articulated a feeling that a lot of people have been feeling recently – a type of working flow state wherein you code via prompts.\n![Andrej Karpathy vibe coding tweet](https://cdn.onplug.io/posts/chat-interfaces/8-vibecoding.png)\n\n> _There's a new kind of coding I call \"vibe coding\", where you fully give in to the vibes, embrace exponentials, and forget that the code even exists. It's possible because the LLMs (e.g. Cursor Composer w Sonnet) are getting too good. Also I just talk to Composer with SuperWhisper so I barely even touch the keyboard. I ask for the dumbest things like \"decrease the padding on the sidebar by half\" because I'm too lazy to find it. I \"Accept All\" always, I don't read the diffs anymore. When I get error messages I just copy paste them in with no comment, usually that fixes it. The code grows beyond my usual comprehension, I'd have to really read through it for a while. Sometimes the LLMs can't fix a bug so I just work around it or ask for random changes until it goes away. It's not too bad for throwaway weekend projects, but still quite amusing. I'm building a project or webapp, but it's not really coding \\- I just see stuff, say stuff, run stuff, and copy paste stuff, and it mostly works._\n\nWhen I use [Cursor](https://www.cursor.com/) and [Claude](https://claude.ai), I sometimes reach this flow state and push features faster than expected. At other times, I find myself in a deadend and have to dump active changes and restart at the most recent working commit.\n\nVibe coding works in software developments thanks to the ability to revert changes. It's a different story for onchain transactions.\n\nDo you really want to vibe code your financial activities?\n\nYou could get away with vibe coding a single trading wallet – this is essentially what I did with Griffain. I said, “Hey I’m feeling frisky today let’s buy some memecoins that fit my parameters” and lil buddy gave me exactly what I wanted.\n\n![Griffain Sniper Bot](https://cdn.onplug.io/posts/chat-interfaces/9-griffain.png)\n\nThe Griffain Sniper Bot I used started buying things quickly and I didn’t have time to respond before it chewed through my deposits; a risk of automation (especially in the context of pseudo-gambling memecoins).\n\nMy experience using AI in development shows how AI can be a powerful thought partner when building complex systems. What if we applied this same collaborative framework to crypto? Instead of asking AI to autonomously manage our assets, what if we used it to help us make better decisions about them?\n\nA different model emerges - one of purposeful collaboration rather than autonomous execution. This suggests a more nuanced approach to AI agents in crypto.\n\n## Building Infrastructure for Agents\n\nRight now, most crypto AI interfaces can swap and bridge because that's all their underlying infrastructure allows. The multi-function agentic future we envision requires more work to achieve.\n\nThis is precisely why we're building Plug the way we are. We're not starting with a chat interface or a single omniscient agent – we're building the foundational infrastructure that enables meaningful agent collaboration. A robust solver that can compose complex transactions across protocols. A growing library of protocol integrations. A framework for writing and executing generalized intents.\n\nWhen we integrate a protocol into Plug, we're expanding the universe of what's possible for every agent in the ecosystem. Each integration creates new possibilities for composition and automation. We're starting from first principles, focusing on the fundamentals that will empower both humans and agents to do more with crypto.\n",attributes:{created:"2025-02-17T06:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}},helloworld:{filename:"say-hello",slug:"hello-world",title:"Hello World.",description:"We are Terminally Online Inc. and you may know us individually as danner or chance. Weve spent the past 5 years plugged into the EVM landscape and were here to plug you in too....",image:"/cdn/papers/hello-world.png",content:"\n\nWe are Terminally Online Inc. and you may know us individually as [danner](https://twitter.com/drakedanner) or [chance](https://twitter.com/nftchance). We've spent the past 5 years plugged into the EVM landscape and we're here to plug you in too.\n\n## The Reality Check\n\nIf you're reading this, you probably have a setup that looks familiar: Multiple monitors, endless Discord and Telegram notifications, and more browser windows than your RAM signed up for. The state of DeFi feels like trying to play 4D chess while juggling. You've got yield farms here, LP positions there, and god forbid you try to time a transaction across multiple protocols without missing the perfect entry.\n\nWe've been there. We are there. And we're building the solution we've always wanted. Initially, when we set out to build Plug, we considered building a product that allowed users to log off and spend more time touching grass. As we continued to build, we realized - that's not who we are; that's not who you are.\n\nLet's be real - I've got 47 browser tabs open right now. This isn't just a problem to solve - it's who we are. The question isn't how to log off, it's how to become even more online. We live in the ether, we spend our days streaming our homes to those we build with. We named our company Terminally Online for a reason. We don't log off and we are here to build for others like us.\n\n## Our Journey Here\n\nI've spent my entire life seeking the cutting edge of functional technology and my entire career in early stage fintech and crypto startups. I've had the opportunity to build teams and hire across every department imaginable. I've gotten to perform a laundry list of operational and technical roles and the teams I've worked with have built systems that have processed $5b+ across compliant Web2 and Web3 rails. I've gotten to work with Chance over the years as he's enabled nearly a million gas optimized transactions and developed delightful software experiences.\nWe're excited to begin releasing product that we fully own and direct.\n\n## Meet Plug\n\nWe're not here to tell you to touch grass. We're here to build the command center for the terminally online. Your protocols, your strategies, your automations - all running exactly how you want them, when you want them. No more tab juggling required.\nFor the first time ever, you can:\n\n- Schedule constraints-driven transactions (because sometimes you need to sleep)\n- Access all major protocol functionality without bouncing between apps\n- Create and share strategies that actually make you money\n- Set up \"if this, then that\" executions that squeeze maximum value from every move\n  One interface to access Ethereum, one interface to combine protocols, one interface to schedule transactions, and one interface to manage your onchain experience.\n\n## What's Coming\n\nWe're starting with Season 0 - our founding users phase. This initial release will be referral-gated, with priority access for everyone on the Plug waitlist. Being a founding user means more than just early access; it comes with built-in advantages that persist:\n\nYour transactions will be evaluated more frequently, leading to better execution. We'll subsidize your gas costs on L2s, and you'll get early access to new features as we roll them out.\n\nWe're taking a seasonal approach to give us flexibility - each season lasting between one to several months. This structure lets us integrate new protocols, test incentive alignment mechanisms, and evolve the product ecosystem based on what we learn together.\n\nWhen we transition to Season 1, our founding users keep their enhanced capabilities. We're building Plug for the long term, and we want our earliest users to remain at the forefront of its evolution.\n\n## The Future\n\nThis isn't just another DeFi tool. We're building the infrastructure for the next generation of onchain activity. A platform where users can compose, automate, and execute complex strategies without compromising on control or capability. This is about unlocking the true potential of being terminally online.\n\nReady to plug in? Join the waitlist at [onplug.io](https://www.onplug.io).\n",attributes:{created:"2025-01-28T06:00:00.000Z",className:"",tags:["perspective"],author:"drakedanner"}}};

        // * Get all the Posts for a given page.
        export const getPosts = (
            page = 1,
            pageSize = PAGE_SIZE,
            filter?:
                | Partial<Record<'date' | 'tag' | 'search', Partial<string>>>
                | undefined
        ): {
            posts: Post[]
            count: number
            hasNext: boolean
            random: Post
        } => {
            // ! Filter the posts before paginating so that we can get a final count.
            const filteredPosts = Object.values(
                Object.values(posts ?? {}).reduce<Record<string, Post>>(
                    (acc, article) => {
                        if(article.attributes.unlisted) return acc

                        if (!filter) {
                            acc[article.slug] = article

                            return acc
                        }

                        const { tag, date, search } = filter

                        // * Check the lowercase tags against the lowercase tag parameter.
                        const matchesTag =
                            !tag ||
                            (article.attributes.tags?.some(
                                articleTag =>
                                    articleTag.toLowerCase() === tag.toLowerCase()
                            ) ??
                                false)

                        // ! Require the exact date match.
                        const matchesDate =
                            !date ||
                            ((article.attributes.created?.includes(date) ||
                                article.attributes.updated?.includes(date)) ??
                                false)

                        const matchesSearch =
                            !search ||
                            article.title
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.description
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            article.content
                                ?.toLowerCase()
                                .includes(search.toLowerCase()) ||
                            (article.attributes.tags?.some(articleTag =>
                                articleTag.toLowerCase().includes(search.toLowerCase())
                            ) ??
                                false)

                        if (matchesTag && matchesDate && matchesSearch) {
                            acc[article.slug] = article
                        }

                        return acc
                    },
                    {}
                )
            )

            const count = filteredPosts.length
            const keys = Object.keys(posts)

            return {
                posts: filteredPosts.slice(
                    (page - 1) * pageSize,
                    page * pageSize
                ),
                count,
                hasNext: count > page * pageSize,
                random: posts[keys[Math.floor(Math.random() * keys.length)]]
            }
        }

        // * Get a specific Post by the value of the slug parameter in each Post.
        // ! The parameter can be the dictionary key or the slug which is a slug on the Post.
        export type PostLookupKey = keyof typeof posts
        export type PostLookup = (typeof posts)[PostLookupKey]['slug']

        export const getPost = (lookup: PostLookup) => {
            const article = posts[lookup.replaceAll('-', '') as PostLookupKey]

            if (!article) throw new Error('Post not found')

            return article
        }

        // * Get the favicon for a given URL.
        export const getFavicon = (url?: string) => {
            if (!url) return null

            const faviconUrl =
                faviconUrls[
                    url
                        .replace('https://', '')
                        .replace('http://', '') as keyof typeof faviconUrls
                ]

            if (!faviconUrl) return null

            return faviconUrl
        }
        